(defn cast->byte
  "u8 0        ..127      ..128      ..255
   i8 0        ..127      ..-128     ..-1
   0b 0000 0000..0000 1111..0001 0000..1111 1111
   0x 00       ..7f       ..80       ..ff"
  [i]
  (byte (if (> i Byte/MAX_VALUE) (- i  0x100) i)))

(defn logo []
  (let [buf (BufferUtils/createByteBuffer (count raw))]
    (doseq [b raw] (.put buf (cast->byte b)))
    (.flip buf)))
(memoize logo)
